import React from 'react';

const ThrashSvg = () => {
  return (
    <svg width="18" height="18" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
    <rect width="24" height="24" fill="none"/>
    <path d="M5 7.5H19L18 21H6L5 7.5Z" stroke="#dcdcdd" stroke-linejoin="round"/>
    <path d="M15.5 9.5L15 19" stroke="#dcdcdd" stroke-linecap="round" stroke-linejoin="round"/>
    <path d="M12 9.5V19" stroke="#dcdcdd" stroke-linecap="round" stroke-linejoin="round"/>
    <path d="M8.5 9.5L9 19" stroke="#dcdcdd" stroke-linecap="round" stroke-linejoin="round"/>
    <path d="M16 5H19C20.1046 5 21 5.89543 21 7V7.5H3V7C3 5.89543 3.89543 5 5 5H8M16 5L15 3H9L8 5M16 5H8" stroke="#dcdcdd" stroke-linejoin="round"/>
    </svg>
  );
};

export default ThrashSvg;
